import React from "react";

function Profile(props)
{
    return(
        <div class = "Profile">
            <h3>Design-Sphere</h3>

            <div class = "ProfileCard">
                <img src = {imageURL} alt = "Cover-Image"></img>
                <span>{Name}</span>
                <span>@{Username}</span>
                <span>{Description}</span>
                <button>View Full Profile</button>
            </div>
        </div>
    );
}

export default Profile;
